def asc_desc_ending_sort(n, m, strings):
    # Generate a list of indices from 1 to n
    indices = [i+1 for i in range(n)]

    # Create a custom sorting function
    def custom_sort(a, b):
        for i in range(m):
            # Odd index
            if i % 2 != 0:
                if a[i] < b[i]:
                    return -1
                elif a[i] > b[i]:
                    return 1
            # Even index
            else:
                if a[i] > b[i]:
                    return -1
                elif a[i] < b[i]:
                    return 1
        return 0

    # Sort the list of indices based on the custom sorting function
    indices.sort(key=lambda i: strings[i-1], cmp=custom_sort)

    return indices
